import React from "react";
import "./App.css";
import Header from "./Header";
import CardHospedagem from "./CardHospedagem";
import Footer from "./Footer";
import { Stack } from "react-bootstrap";

function App() {
  return (
    <div className="App">
      <Header />
      <h1 style={{ padding: "1rem" }}>Hospedagens</h1>
      <Stack direction="horizontal" gap={4}>
        <CardHospedagem />
        <CardHospedagem />
        <CardHospedagem />
        <CardHospedagem />
        <CardHospedagem />
        <CardHospedagem />
      </Stack>
      <Footer />
    </div>
  );
}

export default App;
